		)

self.JavaRModelHasProperty->forAll(Property | 
			self.JavaRModelHasGetter->one(name = 'get' + Property.name)
		)

let AllResourceModels : Sequence(JavaResourceModel) = self.hasJavaRModel in
self.hasJavaRModel->forAll(JRModel | 
	JRModel.JavaRModelHasSetter->select(SetterFunction | 
		(
			JRModel.hasRelatedJavaRMManager.hasRelatedJavaRModel->exists(JRRModel | SetterFunction.name = 'setSetOf' + JRRModel.name)
		)
		or
		(
			AllResourceModels->select(hasRelatedJavaRMManager->exists(hasRelatedJavaRModel = JRModel))
				->exists(ParentJRModel | SetterFunction.name = 'set' + ParentJRModel.parentName)
		)	
	)->forAll(SetterFunction | SetterFunction.SetterFunctionHasJAXBAnnotation->one('@XmlTransient'))
)

self.JavaRMManagerHasProperty->forAll(Property | 
			self.JavaRMManagerHasSetter->one(name = 'set' + Property.name)
		)

self.JavaRMManagerHasProperty->forAll(Property | 
			self.JavaRMManagerHasGetter->one(name = 'get' + Property.name)
		)
